import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import Finish from "./Finish";
function Test() {
  const id = useParams();
  const [data, setData] = useState([]);
  const [qust,setQust]=useState([])
  useEffect(() => {
    fetch("http://interviewapi.ngminds.com/getQuizData")
      .then((response) => response.json())
      .then((json) => setData(json.tests));
  }, []);
  useEffect(
    ()=>{
      if (data.length) {
        if(id.id=="AngularJS Test"){
          setQust(data[0].questions)
         console.log("AngularJS Test");
        }else if (id.id=="Javascript Test") {
          setQust(data[1].questions)
          console.log("Javascript Test");
        }else{
          setQust(data[2].questions)
          console.log("NodeJS Test");
        }
      }
    },[data.length]
  )
 console.log(qust);

const count=0
  return (
    <div className="container">
      <div className="row">
        <h1>My Interview Portal</h1>
        <hr />
        <div className="col-md-12">
          <div className="panel panel-default">
            <div className="panel-heading">{id.id}</div>
            <div className="panel-body">
              <form>
                  <label>{qust[count].questionText}</label>
                  {qust[count].options.map((op, id) => {
                    return (
                      <div className="radio" key={id}>
                        <label>
                          <input
                            type="radio"
                            name="option"
                            value={`${id}`}
                            onChange={(e) => check(e.target.value)}
                          />
                          {op}
                        </label>
                      </div>
                    );
                  })}
                </form>

              <div className="panel-footer">
                <a
                  className="btn btn-success"
                  // onClick={() => incre()}
                >
                  Next
                </a>
                <a
                  href="/finish"
                  className="pull-right btn btn-danger"
                  // onClick={() => end()}
                >
                  Finish
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Test;
